import React, {Component} from 'react';

class Artist extends Component {

    render() {
        const {id, name, title, album} = this.props;
        return (
            <tr>
                <th>{id}</th>
                <th>{name}</th>
                <th>{title}</th>
                <th>{album}</th>
                <th><input type="submit" value="Voir"/></th>
            </tr>
        )
    }
}

export default Artist;
